import { act } from "@testing-library/react"

function intentPage(state = [], action) {
    switch (action.type) {
        case "PAGEINTENTS":
            return action.data.data.data.sort((a, b) => new Date(b.created_time) - new Date(a.created_time))
        default:
            return state
    }
}

export default intentPage
